import { Helmet } from 'react-helmet-async';
import { styled } from '@mui/material/styles';
import { Link, Container, Typography, Divider, Stack, Button } from '@mui/material';
import Carrusel from '../sections/auth/login/Carrucel';

import useResponsive from '../hooks/useResponsive';

import Logo from '../components/logo';
import Iconify from '../components/iconify';
import { LoginForm } from '../sections/auth/login';

const StyledRoot = styled('div')(({ theme }) => ({
  display: 'flex',
  flexDirection: 'column', // Columna en dispositivos pequeños
  [theme.breakpoints.up('md')]: {
    flexDirection: 'row', // Fila en pantallas más grandes (md y superiores)
  },
}));

const StyledSection = styled('div')(({ theme }) => ({
  flex: 1, // Toma el 100% del espacio disponible en dispositivos pequeños
  [theme.breakpoints.up('md')]: {
    flex: '60%', // Toma el 70% del espacio disponible en pantallas más grandes (md y superiores)
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'center',
    boxShadow: theme.customShadows.card,
    backgroundColor: theme.palette.background.default,
  },
}));

const StyledContent = styled('div')(({ theme }) => ({
  flex: 1, // Toma el 100% del espacio disponible en dispositivos pequeños
  display: 'flex',
  justifyContent: 'center',
  flexDirection: 'column',
  padding: theme.spacing(12, 0),
  [theme.breakpoints.up('md')]: {
    flex: '40%', // Toma el 30% del espacio disponible en pantallas más grandes (md y superiores)
    maxWidth: 480,
    margin: 'auto',
    minHeight: '100vh',
  },
}));

export default function LoginPage() {
  const mdUp = useResponsive('up', 'md');

  return (
    <>
      <Helmet>
        <title> Login | GADM RIOBAMBA </title>
      </Helmet>

      <StyledRoot>
        {mdUp && (
          <StyledSection sx={{alignItems:"center", Width:"500px"}}>
          {/*<Carrusel/>*/}
          <svg
      id="Capa_1"
      data-name="Capa 1"
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
      viewBox="0 0 841.89 595.28"
    >
      <defs>
        <clipPath id="clippath">
          <rect x="0" width="841.89" height="595.28" style={{ fill: 'none', strokeWidth: '0px' }} />
        </clipPath>
      </defs>
      <g style={{ clipPath: 'url(#clippath)' }}>
        <rect x=".17" y="187.31" width="107.26" height="26.82" style={{ fill: '#2dabe3', strokeWidth: '0px' }} />
        <rect x="107.43" y="80.15" width="107.26" height="26.82" style={{ fill: '#f9b03d', strokeWidth: '0px' }} />
        <rect x="80.39" y="187.2" width="27.04" height="27.04" style={{ fill: '#30358c', strokeWidth: '0px' }} />
        <rect x="187.9" y="80.16" width="26.8" height="26.8" style={{ fill: '#223260', strokeWidth: '0px' }} />
        <polygon
          points=".17 0 0 153.71 0 187.31 107.43 187.31 107.43 80.15 214.69 80.15 214.69 0 .17 0"
          style={{ fill: '#e83f44', strokeWidth: '0px' }}
        />
        <g>
          <path
            d="m306.31,242.08c1.55,2.01,2.33,4.43,2.33,7.27,0,4.21-1.74,7.46-5.21,9.77-3.47,2.31-8.5,3.46-15.08,3.46h-27.02v-48h25.64c6.4,0,11.23,1.14,14.5,3.43,3.27,2.29,4.9,5.33,4.9,9.12,0,2.24-.56,4.25-1.68,6.03-1.12,1.78-2.78,3.22-4.97,4.32,2.83,1.05,5.03,2.58,6.58,4.59Zm-29.07-16.18v7.13h7.54c3.52,0,5.28-1.19,5.28-3.57s-1.76-3.57-5.28-3.57h-7.54Zm15.08,21.6c0-2.51-1.78-3.77-5.35-3.77h-9.74v7.54h9.74c3.57,0,5.35-1.26,5.35-3.77Z"
            style={{ fill: '#e83f44', strokeWidth: '0px' }}
          />
          <path
            d="m314.84,219.83c-1.71-1.48-2.57-3.37-2.57-5.66s.86-4.17,2.57-5.66c1.71-1.48,3.97-2.23,6.75-2.23s5.1.71,6.79,2.13c1.69,1.42,2.54,3.25,2.54,5.49,0,2.38-.85,4.33-2.54,5.86-1.69,1.53-3.95,2.3-6.79,2.3s-5.04-.74-6.75-2.23Zm-.99,5.25h15.5v37.51h-15.5v-37.51Z"
            style={{ fill: '#e83f44', strokeWidth: '0px' }}
          />
          <path d="m335.86,236.94h20.18v7.22h-27.2v-48h6.02z" style={{ fill: '#e83f44', strokeWidth: '0px' }} />
        </g>
      </g>
    </svg>
          
          {/*<img
            className="d-block w-100"
            //src={"https://emiralfg.com/wp-content/uploads/2022/11/emiral-proyectos-ventas-compras.svg"}
            src={"../../assets/portada.png"}
            alt="First slide"
            
        />*/}
          </StyledSection>

        )}


        <StyledContent sx={{alignItems:"center"}}>
          <Typography variant="h4" sx={{fontFamily:" Roman", color: "blue"}}>

          <img src="../../assets/iconoRiobamba.png" alt="login" width="300px" />

          </Typography>
          <Divider sx={{ my: 1 }} />
          <LoginForm />
        </StyledContent>
      </StyledRoot>
    </>
  );
}
